import React, { useState, useEffect, useRef, useCallback } from 'react';
import './App.css';
import { DataFetcher } from './DataFetch';
import { Analytics } from './Analytics';
import { StockData, AnalyticsResult, AnalyticsParams } from './types';
import { HistoricalChart, VolatilityChart, MonteCarloPathsChart, DistributionChart } from './Charts';

function App() {
  const [stockData, setStockData] = useState<StockData | null>(null);
  const [analyticsResult, setAnalyticsResult] = useState<AnalyticsResult | null>(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<string | null>(null);
  const [ticker, setTicker] = useState('AAPL');
  const [activeTab, setActiveTab] = useState('historical');
  const [settingsOpen, setSettingsOpen] = useState(false);
  const [simulationParams, setSimulationParams] = useState<AnalyticsParams>({
    alpha: 0.1,
    beta: 0.8,
    theta: 0.05,
    switchProb: 0.05,
    numPaths: 1000,
    numSteps: 252
  });

  const workerRef = useRef<Worker | null>(null);
  const dataFetcherRef = useRef<DataFetcher>(new DataFetcher());

  // Fetch stock data
  const fetchData = useCallback(async (symbol: string) => {
    if (!dataFetcherRef.current.hasApiKey()) {
      setError('Please set up your API key in Settings to fetch stock data');
      return;
    }

    setLoading(true);
    setError(null);
    try {
      const data = await dataFetcherRef.current.fetchStockData(symbol);
      setStockData(data);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to fetch data');
    } finally {
      setLoading(false);
    }
  }, []);

  // Run Monte Carlo simulation
  const runSimulation = useCallback(async () => {
    if (!stockData) return;

    setLoading(true);
    setError(null);

    try {
      // Create Web Worker for Monte Carlo simulation
      const workerCode = `
        // Analytics class methods
        const Analytics = {
          calculateReturns: ${Analytics.calculateReturns.toString()},
          calculateGARCHVolatility: ${Analytics.calculateGARCHVolatility.toString()},
          calculateTrendAndDrift: ${Analytics.calculateTrendAndDrift.toString()},
          generateMarkovRegime: ${Analytics.generateMarkovRegime.toString()},
          runMonteCarloSimulation: ${Analytics.runMonteCarloSimulation.toString()}
        };

        self.onmessage = function(e) {
          try {
            const returns = Analytics.calculateReturns(e.data.stockData.prices);
            const volatilities = Analytics.calculateGARCHVolatility(returns, e.data.params.alpha, e.data.params.beta);
            const trendDrift = Analytics.calculateTrendAndDrift(e.data.stockData.prices, e.data.params.theta);
            const regimes = Analytics.generateMarkovRegime(returns, e.data.params.switchProb);

            const result = Analytics.runMonteCarloSimulation(
              e.data.stockData.currentPrice,
              e.data.params,
              volatilities[volatilities.length - 1],
              trendDrift.drift
            );

            // Add additional data to result
            result.currentVolatility = volatilities[volatilities.length - 1];
            result.trend = trendDrift.trend;
            result.drift = trendDrift.drift;

            self.postMessage({ success: true, result });
          } catch (error) {
            self.postMessage({ success: false, error: error.message });
          }
        };
      `;

      const blob = new Blob([workerCode], { type: 'application/javascript' });
      workerRef.current = new Worker(URL.createObjectURL(blob));

      workerRef.current.onmessage = (e) => {
        if (e.data.success) {
          setAnalyticsResult(e.data.result);
        } else {
          setError(e.data.error);
        }
        setLoading(false);
      };

      workerRef.current.onerror = (e) => {
        setError('Simulation failed: ' + e.message);
        setLoading(false);
      };

      workerRef.current.postMessage({
        stockData,
        params: simulationParams
      });

    } catch (err) {
      setError(err instanceof Error ? err.message : 'Simulation failed');
      setLoading(false);
    }
  }, [stockData, simulationParams]);

  // Cleanup worker on unmount
  useEffect(() => {
    return () => {
      if (workerRef.current) {
        workerRef.current.terminate();
      }
    };
  }, []);

  // Run simulation when stock data changes
  useEffect(() => {
    if (stockData) {
      runSimulation();
    }
  }, [stockData, runSimulation]);

  const handleTickerChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setTicker(e.target.value.toUpperCase());
  };

  const handleTickerSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    fetchData(ticker);
  };

  const updateSimulationParam = (param: keyof AnalyticsParams, value: number) => {
    setSimulationParams((prev: AnalyticsParams) => ({
      ...prev,
      [param]: value
    }));
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-slate-50 to-slate-100">
      {/* Header */}
      <header className="bg-white/80 backdrop-blur-xl border-b border-slate-200/50 sticky top-0 z-50">
        <div className="max-w-7xl mx-auto px-6 py-4">
          <div className="flex justify-between items-center">
            <div className="flex items-center space-x-4">
              <div className="w-8 h-8 bg-gradient-to-br from-blue-500 to-purple-600 rounded-lg flex items-center justify-center">
                <svg className="w-5 h-5 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
                </svg>
              </div>
              <h1 className="text-xl font-semibold text-slate-900">Finance Analytics</h1>
            </div>

            <div className="flex items-center space-x-3">
              {/* Ticker Input */}
              <form onSubmit={handleTickerSubmit} className="flex items-center">
                <div className="relative">
                  <input
                    type="text"
                    value={ticker}
                    onChange={handleTickerChange}
                    placeholder="Enter ticker..."
                    className="w-32 px-4 py-2 bg-white/50 backdrop-blur-sm border border-slate-200/50 rounded-full text-sm font-medium text-slate-900 placeholder-slate-500 focus:outline-none focus:ring-2 focus:ring-blue-500/20 focus:border-blue-500 transition-all duration-200"
                  />
                  <div className="absolute inset-y-0 right-0 flex items-center pr-3">
                    <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
                  </div>
                </div>
                <button
                  type="submit"
                  disabled={loading}
                  className="ml-2 px-6 py-2 bg-gradient-to-r from-blue-500 to-purple-600 text-white text-sm font-medium rounded-full hover:from-blue-600 hover:to-purple-700 focus:outline-none focus:ring-2 focus:ring-blue-500/20 disabled:opacity-50 disabled:cursor-not-allowed transition-all duration-200 shadow-lg shadow-blue-500/25"
                >
                  {loading ? (
                    <div className="flex items-center space-x-2">
                      <div className="w-4 h-4 border-2 border-white/30 border-t-white rounded-full animate-spin"></div>
                      <span>Analyzing...</span>
                    </div>
                  ) : (
                    'Analyze'
                  )}
                </button>
              </form>

              {/* Settings Button */}
              <button
                onClick={() => setSettingsOpen(true)}
                className="p-2 text-slate-600 hover:text-slate-900 hover:bg-slate-100 rounded-full transition-all duration-200"
              >
                <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10.325 4.317c.426-1.756 2.924-1.756 3.35 0a1.724 1.724 0 002.573 1.066c1.543-.94 3.31.826 2.37 2.37a1.724 1.724 0 001.065 2.572c1.756.426 1.756 2.924 0 3.35a1.724 1.724 0 00-1.066 2.573c.94 1.543-.826 3.31-2.37 2.37a1.724 1.724 0 00-2.572 1.065c-.426 1.756-2.924 1.756-3.35 0a1.724 1.724 0 00-2.573-1.066c-1.543.94-3.31-.826-2.37-2.37a1.724 1.724 0 00-1.065-2.572c-1.756-.426-1.756-2.924 0-3.35a1.724 1.724 0 001.066-2.573c-.94-1.543.826-3.31 2.37-2.37.996.608 2.296.07 2.572-1.065z" />
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 12a3 3 0 11-6 0 3 3 0 016 0z" />
                </svg>
              </button>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="max-w-7xl mx-auto px-6 py-8">
        {error && (
          <div className="mb-6 p-4 bg-red-50 border border-red-200 rounded-2xl">
            <div className="flex items-center space-x-3">
              <div className="w-5 h-5 bg-red-500 rounded-full flex items-center justify-center">
                <svg className="w-3 h-3 text-white" fill="currentColor" viewBox="0 0 20 20">
                  <path fillRule="evenodd" d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z" clipRule="evenodd" />
                </svg>
              </div>
              <p className="text-red-800 font-medium">{error}</p>
            </div>
          </div>
        )}

        {stockData && (
          <>
            {/* Stock Info Card */}
            <div className="mb-8 bg-white/60 backdrop-blur-sm rounded-3xl shadow-xl shadow-slate-200/50 border border-white/50 p-8">
              <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
                <div className="space-y-4">
                  <div className="flex items-center space-x-3">
                    <h2 className="text-3xl font-bold text-slate-900">{stockData.ticker}</h2>
                    <div className="px-3 py-1 bg-green-100 text-green-800 text-sm font-medium rounded-full">
                      Active
                    </div>
                  </div>
                  <p className="text-4xl font-bold text-green-600">
                    ${stockData.currentPrice.toFixed(2)}
                  </p>
                  <p className="text-slate-600">Current Price</p>
                </div>

                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">Valuation Metrics</h3>
                  <div className="space-y-3">
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">P/E Ratio</span>
                      <span className="font-semibold text-slate-900">
                        {stockData.fundamentals.pe?.toFixed(2) || 'N/A'}
                      </span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">Market Cap</span>
                      <span className="font-semibold text-slate-900">
                        ${(stockData.fundamentals.marketCap ? stockData.fundamentals.marketCap / 1e9 : 0).toFixed(2)}B
                      </span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">Dividend Yield</span>
                      <span className="font-semibold text-slate-900">
                        {stockData.fundamentals.dividendYield?.toFixed(2) || 'N/A'}%
                      </span>
                    </div>
                  </div>
                </div>

                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">Additional Metrics</h3>
                  <div className="space-y-3">
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">P/B Ratio</span>
                      <span className="font-semibold text-slate-900">
                        {stockData.fundamentals.pb?.toFixed(2) || 'N/A'}
                      </span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">PEG Ratio</span>
                      <span className="font-semibold text-slate-900">
                        {stockData.fundamentals.peg?.toFixed(2) || 'N/A'}
                      </span>
                    </div>
                    <div className="flex justify-between items-center">
                      <span className="text-slate-600">EPS</span>
                      <span className="font-semibold text-slate-900">
                        {stockData.fundamentals.eps?.toFixed(2) || 'N/A'}
                      </span>
                    </div>
                  </div>
                </div>
              </div>
            </div>

            {/* Navigation Tabs */}
            <div className="mb-8">
              <nav className="flex space-x-1 bg-white/60 backdrop-blur-sm rounded-2xl p-2 border border-white/50">
                {[
                  { id: 'historical', label: 'Historical Data', icon: 'ðŸ“ˆ' },
                  { id: 'volatility', label: 'Volatility Analysis', icon: 'ðŸ“Š' },
                  { id: 'monte-carlo', label: 'Monte Carlo Simulation', icon: 'ðŸŽ²' },
                  { id: 'distribution', label: 'Price Distribution', icon: 'ðŸ“‰' },
                  { id: 'metrics', label: 'Risk Metrics', icon: 'âš ï¸' }
                ].map((tab) => (
                  <button
                    key={tab.id}
                    onClick={() => setActiveTab(tab.id)}
                    className={`flex items-center space-x-2 px-6 py-3 rounded-xl text-sm font-medium transition-all duration-200 ${
                      activeTab === tab.id
                        ? 'bg-white text-slate-900 shadow-lg shadow-slate-200/50'
                        : 'text-slate-600 hover:text-slate-900 hover:bg-white/50'
                    }`}
                  >
                    <span>{tab.icon}</span>
                    <span>{tab.label}</span>
                  </button>
                ))}
              </nav>
            </div>

            {/* Charts */}
            {analyticsResult && (
              <div className="bg-white/60 backdrop-blur-sm rounded-3xl shadow-xl shadow-slate-200/50 border border-white/50 p-8">
                {activeTab === 'historical' && (
                  <HistoricalChart
                    prices={stockData.prices}
                    trend={analyticsResult.trend}
                    isDarkMode={false}
                  />
                )}
                {activeTab === 'volatility' && (
                  <VolatilityChart
                    prices={stockData.prices}
                    volatilities={[]} // TODO: Calculate volatilities
                    regimes={[]} // TODO: Calculate regimes
                    isDarkMode={false}
                  />
                )}
                {activeTab === 'monte-carlo' && (
                  <MonteCarloPathsChart
                    paths={analyticsResult.paths}
                    initialPrice={stockData.currentPrice}
                    isDarkMode={false}
                  />
                )}
                {activeTab === 'distribution' && (
                  <DistributionChart
                    histogram={analyticsResult.histogram}
                    initialPrice={stockData.currentPrice}
                    isDarkMode={false}
                  />
                )}
                {activeTab === 'metrics' && (
                  <div className="space-y-6">
                    <h3 className="text-2xl font-bold text-slate-900">Risk Analysis</h3>
                    <div className="grid grid-cols-2 md:grid-cols-4 gap-6">
                      <div className="bg-gradient-to-br from-red-50 to-red-100 p-6 rounded-2xl border border-red-200">
                        <h4 className="text-sm font-medium text-red-700 mb-2">VaR (95%)</h4>
                        <p className="text-2xl font-bold text-red-800">
                          ${analyticsResult.var95.toFixed(2)}
                        </p>
                        <p className="text-xs text-red-600 mt-1">Value at Risk</p>
                      </div>
                      <div className="bg-gradient-to-br from-orange-50 to-orange-100 p-6 rounded-2xl border border-orange-200">
                        <h4 className="text-sm font-medium text-orange-700 mb-2">VaR (99%)</h4>
                        <p className="text-2xl font-bold text-orange-800">
                          ${analyticsResult.var99.toFixed(2)}
                        </p>
                        <p className="text-xs text-orange-600 mt-1">Extreme Risk</p>
                      </div>
                      <div className="bg-gradient-to-br from-green-50 to-green-100 p-6 rounded-2xl border border-green-200">
                        <h4 className="text-sm font-medium text-green-700 mb-2">Upside 20%</h4>
                        <p className="text-2xl font-bold text-green-800">
                          {(analyticsResult.probabilities.upside20 * 100).toFixed(1)}%
                        </p>
                        <p className="text-xs text-green-600 mt-1">Growth Probability</p>
                      </div>
                      <div className="bg-gradient-to-br from-blue-50 to-blue-100 p-6 rounded-2xl border border-blue-200">
                        <h4 className="text-sm font-medium text-blue-700 mb-2">Downside 10%</h4>
                        <p className="text-2xl font-bold text-blue-800">
                          {(analyticsResult.probabilities.downside10 * 100).toFixed(1)}%
                        </p>
                        <p className="text-xs text-blue-600 mt-1">Decline Probability</p>
                      </div>
                    </div>
                  </div>
                )}
              </div>
            )}

            {loading && (
              <div className="flex justify-center items-center py-16">
                <div className="text-center space-y-4">
                  <div className="w-16 h-16 border-4 border-slate-200 border-t-blue-500 rounded-full animate-spin mx-auto"></div>
                  <p className="text-slate-600 font-medium">Running Monte Carlo simulation...</p>
                  <p className="text-sm text-slate-500">This may take a few moments</p>
                </div>
              </div>
            )}
          </>
        )}

        {!stockData && !loading && (
          <div className="text-center py-20">
            <div className="w-24 h-24 bg-gradient-to-br from-blue-100 to-purple-100 rounded-3xl flex items-center justify-center mx-auto mb-6">
              <svg className="w-12 h-12 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
              </svg>
            </div>
            <h2 className="text-2xl font-bold text-slate-900 mb-2">Ready to Analyze</h2>
            <p className="text-slate-600 max-w-md mx-auto">
              Enter a stock ticker symbol above to begin your financial analysis with advanced Monte Carlo simulations and risk metrics.
            </p>
          </div>
        )}
      </main>

      {/* Settings Drawer */}
      {settingsOpen && (
        <div className="fixed inset-0 z-50 overflow-hidden">
          {/* Backdrop */}
          <div 
            className="absolute inset-0 bg-black/20 backdrop-blur-sm"
            onClick={() => setSettingsOpen(false)}
          />

          {/* Drawer */}
          <div className="absolute right-0 top-0 h-full w-full max-w-md bg-white shadow-2xl">
            <div className="flex flex-col h-full">
              {/* Header */}
              <div className="flex items-center justify-between p-6 border-b border-slate-200">
                <h2 className="text-xl font-semibold text-slate-900">Settings</h2>
                <button
                  onClick={() => setSettingsOpen(false)}
                  className="p-2 text-slate-400 hover:text-slate-600 rounded-full hover:bg-slate-100 transition-colors"
                >
                  <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
                  </svg>
                </button>
              </div>

              {/* Content */}
              <div className="flex-1 overflow-y-auto p-6 space-y-8">
                {/* API Keys Section */}
                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">API Configuration</h3>
                  <p className="text-sm text-slate-600">
                    Configure your API keys to access real-time financial data.
                  </p>

                  <div className="space-y-4">
                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Alpha Vantage API Key
                      </label>
                      <input
                        type="password"
                        placeholder="Enter your Alpha Vantage API key"
                        className="w-full px-4 py-3 border border-slate-200 rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                        onChange={(e) => {
                          if (e.target.value) {
                            dataFetcherRef.current.setApiKey(e.target.value, 'alphavantage');
                          }
                        }}
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        Get your free API key at <a href="https://www.alphavantage.co" target="_blank" rel="noopener noreferrer" className="text-blue-600 hover:underline">alphavantage.co</a>
                      </p>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Polygon API Key
                      </label>
                      <input
                        type="password"
                        placeholder="Enter your Polygon API key"
                        className="w-full px-4 py-3 border border-slate-200 rounded-xl focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                        onChange={(e) => {
                          if (e.target.value) {
                            dataFetcherRef.current.setApiKey(e.target.value, 'polygon');
                          }
                        }}
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        Get your free API key at <a href="https://polygon.io" target="_blank" rel="noopener noreferrer" className="text-blue-600 hover:underline">polygon.io</a>
                      </p>
                    </div>
                  </div>
                </div>

                {/* Simulation Settings */}
                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">Advanced Simulation</h3>
                  <p className="text-sm text-slate-600">
                    Fine-tune the Monte Carlo simulation parameters for more accurate results.
                  </p>

                  <div className="space-y-4">
                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Alpha (Î±): {simulationParams.alpha}
                      </label>
                      <input
                        type="range"
                        min="0.01"
                        max="0.3"
                        step="0.01"
                        value={simulationParams.alpha}
                        onChange={(e) => updateSimulationParam('alpha', parseFloat(e.target.value))}
                        className="w-full"
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        GARCH volatility persistence parameter
                      </p>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Beta (Î²): {simulationParams.beta}
                      </label>
                      <input
                        type="range"
                        min="0.5"
                        max="0.95"
                        step="0.01"
                        value={simulationParams.beta}
                        onChange={(e) => updateSimulationParam('beta', parseFloat(e.target.value))}
                        className="w-full"
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        GARCH volatility clustering parameter
                      </p>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Theta (Î¸): {simulationParams.theta}
                      </label>
                      <input
                        type="range"
                        min="0.01"
                        max="0.2"
                        step="0.01"
                        value={simulationParams.theta}
                        onChange={(e) => updateSimulationParam('theta', parseFloat(e.target.value))}
                        className="w-full"
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        Mean reversion strength
                      </p>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Regime Switch: {(simulationParams.switchProb * 100).toFixed(1)}%
                      </label>
                      <input
                        type="range"
                        min="0.01"
                        max="0.2"
                        step="0.01"
                        value={simulationParams.switchProb}
                        onChange={(e) => updateSimulationParam('switchProb', parseFloat(e.target.value))}
                        className="w-full"
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        Market regime change probability
                      </p>
                    </div>

                    <div>
                      <label className="block text-sm font-medium text-slate-700 mb-2">
                        Number of Paths: {simulationParams.numPaths}
                      </label>
                      <input
                        type="range"
                        min="100"
                        max="5000"
                        step="100"
                        value={simulationParams.numPaths}
                        onChange={(e) => updateSimulationParam('numPaths', parseInt(e.target.value))}
                        className="w-full"
                      />
                      <p className="text-xs text-slate-500 mt-1">
                        More paths = more accurate results (slower computation)
                      </p>
                    </div>
                  </div>
                </div>

                {/* Display Settings */}
                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">Display</h3>
                  <div className="space-y-3">
                    <label className="flex items-center space-x-3">
                      <input type="checkbox" className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500" />
                      <span className="text-sm text-slate-700">Show loading animations</span>
                    </label>
                    <label className="flex items-center space-x-3">
                      <input type="checkbox" className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500" defaultChecked />
                      <span className="text-sm text-slate-700">Auto-refresh data</span>
                    </label>
                    <label className="flex items-center space-x-3">
                      <input type="checkbox" className="w-4 h-4 text-blue-600 rounded focus:ring-blue-500" defaultChecked />
                      <span className="text-sm text-slate-700">Show tooltips</span>
                    </label>
                  </div>
                </div>

                {/* Data Management */}
                <div className="space-y-4">
                  <h3 className="text-lg font-semibold text-slate-900">Data Management</h3>
                  <div className="space-y-3">
                    <button className="w-full px-4 py-3 text-left text-sm text-red-600 hover:bg-red-50 rounded-xl transition-colors">
                      Clear all cached data
                    </button>
                    <button className="w-full px-4 py-3 text-left text-sm text-red-600 hover:bg-red-50 rounded-xl transition-colors">
                      Clear API keys
                    </button>
                  </div>
                </div>
              </div>

              {/* Footer */}
              <div className="p-6 border-t border-slate-200">
                <button
                  onClick={() => setSettingsOpen(false)}
                  className="w-full px-6 py-3 bg-gradient-to-r from-blue-500 to-purple-600 text-white font-medium rounded-xl hover:from-blue-600 hover:to-purple-700 transition-all duration-200 shadow-lg shadow-blue-500/25"
                >
                  Done
                </button>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default App;
